import{_ as s,c as e,o as t,ag as n}from"./chunks/framework.Ds6Eueu6.js";const u=JSON.parse('{"title":"MOVE","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/MOVE.md","filePath":"docs/7x/ref_guide/sql_commands/MOVE.md"}'),o={name:"docs/7x/ref_guide/sql_commands/MOVE.md"};function i(p,a,c,l,d,r){return t(),e("div",null,a[0]||(a[0]=[n(`<h1 id="move" tabindex="-1">MOVE <a class="header-anchor" href="#move" aria-label="Permalink to &quot;MOVE&quot;">​</a></h1><p>Positions a cursor.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>MOVE [ &lt;forward_direction&gt; [ FROM | IN ] ] &lt;cursor_name&gt;</span></span></code></pre></div><p>where &lt;forward_direction&gt; can be empty or one of:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>    NEXT</span></span>
<span class="line"><span>    FIRST</span></span>
<span class="line"><span>    LAST</span></span>
<span class="line"><span>    ABSOLUTE &lt;count&gt;</span></span>
<span class="line"><span>    RELATIVE &lt;count&gt;</span></span>
<span class="line"><span>    &lt;count&gt;</span></span>
<span class="line"><span>    ALL</span></span>
<span class="line"><span>    FORWARD</span></span>
<span class="line"><span>    FORWARD &lt;count&gt;</span></span>
<span class="line"><span>    FORWARD ALL</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>MOVE</code> repositions a cursor without retrieving any data. <code>MOVE</code> works exactly like the <a href="./FETCH.html">FETCH</a> command, except it only positions the cursor and does not return rows.</p><blockquote><p><strong>Note</strong> You cannot <code>MOVE</code> a <code>PARALLEL RETRIEVE CURSOR</code>.</p></blockquote><blockquote><p><strong>Note</strong> Because WarehousePG does not support scrollable cursors, it is not possible to move a cursor position backwards. You can only move a cursor forward in position using <code>MOVE</code>.</p></blockquote><p>The parameters for the <code>MOVE</code> command are identical to those of the <code>FETCH</code> command; refer to <a href="./FETCH.html">FETCH</a> for details on syntax and usage.</p><h2 id="outputs" tabindex="-1"><a id="section5a"></a>Outputs <a class="header-anchor" href="#outputs" aria-label="Permalink to &quot;&lt;a id=&quot;section5a&quot;&gt;&lt;/a&gt;Outputs&quot;">​</a></h2><p>On successful completion, a <code>MOVE</code> command returns a command tag of the form</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>MOVE &lt;count&gt;</span></span></code></pre></div><p>The count is the number of rows that a <code>FETCH</code> command with the same parameters would have returned (possibly zero).</p><h2 id="examples" tabindex="-1"><a id="section6"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Start the transaction:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>BEGIN;</span></span></code></pre></div><p>Create a cursor:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DECLARE mycursor CURSOR FOR SELECT * FROM films;</span></span></code></pre></div><p>Skip the first 5 rows in the cursor <code>mycursor</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>MOVE FORWARD 5 IN mycursor;</span></span>
<span class="line"><span>MOVE 5</span></span></code></pre></div><p>Fetch the next row after that (row 6):</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>FETCH 1 FROM mycursor;</span></span>
<span class="line"><span> code  | title  | did | date_prod  |  kind  |  len</span></span>
<span class="line"><span>-------+--------+-----+------------+--------+-------</span></span>
<span class="line"><span> P_303 | 48 Hrs | 103 | 1982-10-22 | Action | 01:37</span></span>
<span class="line"><span>(1 row)</span></span></code></pre></div><p>Close the cursor and end the transaction:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>CLOSE mycursor;</span></span>
<span class="line"><span>COMMIT;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section7"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p>There is no <code>MOVE</code> statement in the SQL standard.</p><h2 id="see-also" tabindex="-1"><a id="section8"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section8&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./DECLARE.html">DECLARE</a>, <a href="./FETCH.html">FETCH</a>, <a href="./CLOSE.html">CLOSE</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>`,31)]))}const m=s(o,[["render",i]]);export{u as __pageData,m as default};
